import React from 'react';
import './Gallery.css';

const winners = [
  { rank: 1, name: 'John Doe', score: 100 },
  { rank: 2, name: 'Jane Smith', score: 90 },
  { rank: 3, name: 'Bob Johnson', score: 80 },
  { rank: 4, name: 'Alice Jones', score: 70 },
  { rank: 5, name: 'Tom Williams', score: 60 },
];

const Leaderboard = () => {
  return (
    <div className="leaderboard-container">
      <h2 className="leaderboard-title">Leaderboard</h2>
      <table className="leaderboard-table">
        <thead>
          <tr>
            <th>Rank</th>
            <th>Name</th>
            <th>Score</th>
          </tr>
        </thead>
        <tbody>
          {winners.map((winner) => (
            <tr key={winner.rank}>
              <td>{winner.rank}</td>
              <td>{winner.name}</td>
              <td>{winner.score}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Leaderboard;
